import React from 'react';
import img1 from './head-img1.jpg';
import './Head.css';

const Navbar = (props) => {
    return (
        <div className='head'>
            {/* <div className="head-img">
                <img src={img1}  alt="" />
            </div> */}
            <div class="flex justify-center">
  <div
    class="block max-w-sm rounded-lg bg-white shadow-lg dark:bg-neutral-100">
    <a href="#!">
      <img
        class="rounded-t-lg"
        src="https://tecdn.b-cdn.net/img/new/standard/nature/184.jpg"
        alt="" />
    </a>
    
  </div>
</div>
        </div>
        
    )
    
}

export default Navbar
